;; @@
(def m-map 
  (key 
  	(apply max-key 
      val 
        (empirical-distribution
          (collect-by #(:m (:result %)) samples)))))

(def w-exp
  (empirical-mean 
    (collect-by #(:w (:result %)) (filter #(= (:m (:result %)) m-map) samples))))

(println "M:" m-map)
(println "w:" w-exp)
